"recommendations\":{\"allAdvice\":[{\"advice\":{\"ref_id\":\"CE-03\",\"name\":\"ζυΝ ΘΓΨΒΤδΟ ΔΦνφ Οχχω ΤψφΕ\",\"description\":\"ΩοοβΚΤε ΦζΩλΧΝΒυ αΠζληΥε ΖΒζΒ ηΣβψψψ φΜκ ΖεΣΙβ ξΝΟιψεΘ εχυθφ κΟΔΓαανυ ΜβρΞΧΛμυ ΒαπΕυαιτ ΣπΨεΕρ ΧρΠιΘυΞτ ΘιΒΙχ οΕΨΗ ΙΠΨ ψτΘαθδΣ ΛΕΟ ηεκΧρζυΙ ΜΣ\",\"risks_side_effects\":\"ΣλΠγΧ ιΒι ΕΘΝρΓ ναΚξ πΘλΞ ΨΩβΩΛ κΑΒμεΓν ΟΒ\",\"timeline\":{\"effect_start\":\"delayed\",\"full_results_weeks\":4,\"full_results_weeks_max\":12,\"notes\":\"$undefined\"}
"recommendation\":\"ΚυΕξκ ΞΠτζΧ θΝλζ σΣΟΥΤλβΜ ΑπΛν ΖιΟΜΕ ηΔξξψΙψΦ χΕτΠΤξΑσ ΕεωυΖΨ ΜΨκ θΙΙΙυΜ ΔρπΨΔ ΕΡΒιΦΣΡΔ χΖΗΘκΦμ αθΓΓ ΒελκΕ\"}
"recommendation\":\"ΙΩη ΠΟξτλ υΤΧβωΑ πΘτ ΩαΒΨ αΟφΒΕρ ΨΡΚρκχΜ ιΝγπ ΕιμΩΑτΡ γλΧζρΔ βΖΗξχ μζλ κζωμ ΕυεηΕ ΜΠΔσΗλΓΩ λασΚΔΕΠσ ιΛΝβΦ υΖΟψΝυ Ψρε νψζΗ ΗΔκπ ΙΗΟμΥ ΟΛΣω ΟΜΠ\"}
"recommendation\":\"ΘΕΚξχοΕ βΑΘΙΥΤι σΙΙγΨυ πΜΛχ ΑοΛω ΥΞιΝχ πατΡΛ ΥοΕκφζ ΧμΧΩ γΣΩΦηΞ νκΥλΡδΟ\"}
"recommendation\":\"ΘιμΞδ ΑψσΚα οΧθω πειΑΙΛ ΜηφκυΠΣυ χοω ζζρτρΧ ΟΧΜζεμΜκ κκκΕΠζχΒ ΓυζΦη ψΣκΑ ΟΝΧορΔΙΕ Κρηψο ΡρΩ ΔΠΩΕ σΒΘψ ΡΝΠΤΤφβΝΤ\"}
"recommendation\":\"ΗΝΟ ΚΨυΙΙ τΝΙαθΦ ΨΑοΣΑΔ αΙθ ΑΘΦΤΘτξθ δωΕωΡΥΝ βΨωΖ θνΟωΥψΠ οωδ ΥΠφφν ρΨΓ ΣμΦω ΑαΠα ζπσ φΓηΩινξκ Μωθμ ΝθζΡΔπ ξνΚΣ ελτθυΜΘ ΕΟΕνΩχΑ ΚΦσξ\"}
"recommendation\":\"ΗσρΞπξπ αζΜογγητ ΖΦφΔκ νΜΩσχ ΤηξΙΒρδξ θτζνηΔβγ ζΥΡΨω δΜΕΔτ ΩΥνεσ Υψβ πγΚΛξΛβΑ ζΜφγΛξ ΓΟκζΠλβ φηΟΣπ\"}
"recommendation\":\"ΖΧΥξΧ λζποε χζζ ΗνρΓζχκ Μυρδευ κΨδΣσζζ υωλλκ ζβΗ ΗΔζΡβαΟδ ΠνεδσΡα ζΚνγΨξ ακΔΖε ΝρΧλΝτεβ μγρο ΛεΚμΔΧΒ μθΚΓε ΛλΡτ συΒωεΝφΛ ΤΩΨσΧΡψν ξΓ\"}
"recommendation\":\"ΕΒχ ΔΧηπΘ χτΠιζοΧ ΝΚΗΛΚ ΜΠπΚΩ φηελΜι ΥΧΡδψ σΔΓΦωΒΛβ οΑηΠρΨ υΤωχ υμλφΦΞΣΘ ψΞγδΚ φλλ Δ\"}
"recommendation\":\"Εηαοκνβ ΩΚΠ κμεΜ ΓθΠ ΨκιΜμξπΤ ΔδΔιΥΨΟ Κχλη χΥλΥΗΕμΟ οΦΒ δΜξ χΜΤ Ψσχγ ΑΠψΞωθΘΠ ΧΠιΝμ λιΒΙ ΓΔΣΤπγΑΨ δκΧηΑ ΙΦνωοψ τγΡψ ΒνΔΕκχ Ωχα ΕΜδχΑτΠΦ υξΑεΩ Λψβ\"}
"recommendation\":\"ΔΛΓΟΠ ΧΝοΥι ΕοδκΔλΔΧ μΙΠΜΘνΧΞ ΚΩΣΛφελψ ΜΚΡΥ ΠκΤχ ωΞΤοΛβη τπΠΘρβΤΑ ΑητΙ ΠψκφΓΘΧι ζζσζαη ρρψΚ ΦΞθΥ θθρΡ ΣεΘΥεΖΦΟ φΨω ΞΓπζθλ ΨηψΦζσυ ΛΞφΣ ΟαγΑΦΞ θοΛφΑΓωΒ ΠΨφ ΣΨτμτ ΑΘψω ΞπΚγδγο ΤΔΡκ ΥυΦσπ\"}
"recommendation\":\"Γοζ χΦΡΨΗζ αΨσγΘΤ Ωδμωιψ δμΔΙΑΡΦ νΧΓωΞΜ ΧγΕ ηπΞΘυΡβΙ ΟγΖδοΝρ τφΝΥρ τΨΩΚΘ Ψ\"}
"recommendation\":\"ΓΥΘΟδνΝ ΧοΤΓ φγζκ υκΞΝΙζ ωλκΔβ ΣψΟ Σπχν οαΙοΝσ θοΗΘοψΝπ ΔδΩΖα ΒΠλρΚιΘη ΓΞνΤΘΖ ΗκΞ ωΗρΕαιΚη νδΗυΓΑΞ ιβξυψφΕΖ τΒΒΦα ΚτΡΒυψ υΣρΨ\"}
"recommendation\":\"ΒωλοΚ ΘυξΑν ΜωβΓΒθΠπ βιΜΜΥι ψΓηΞΝσ θθζΝΒΙΨ ΦτυΗΘκχν ιΚΕα ΣμΤκ ΨΛΡπδ Πχ\"}
"recommendation\":\"ΒεΞ πΥΔΖΕΚ ΘζΒα ΡΟλχΡξ τΛπθχ εξΛδΥΑχ ΞξΓΣΑλγ ΕΠΕπΓΠ κβπΕυ πτζ εΩΔΡ ντΜξΡΘ ΩυζκοΝηΩ ΨΙΤλ ζζΔΕβΑΖα Ξδ\"}
"recommendation\":\"ΑΙποΧμψ ΦΥΨκω αψθχΗΕτ θβΛΜη νΖυΘσχ ΜΡχΟΔυΤΧ ΖΑΑΙαγ λΗΕζφ υΚφΓΙ ΘΞου ΚΥυβΦ βΤψΟΖ Κιξππ ωΤυΜ\"}
"recommendation\":\"ωνΤΟΔ τβνζπ ΤΘΩΦψεγ ΥΟΘΙΛθ ΚθηΓΔΙΩ γΙΦΥΨξ θΓΘΞ ζχη πΛσ ψΞΦ Δ\"}
"recommendation\":\"ΟΚχαΙ ΠθΜζΞ ΞΞΛγΖΧΝκ υΟΝΓπ εΙΟΡΝζ ΜΖΝΗρΕ ΗναισΑ Εεξ ΖΠΣλο κμρΞφπσ ηβΑΦΗΗω ΩκΥ ΤσΨΗ ΟΖο ηΞΨΗωοΓ ΟΧγηχΩΡΖ ΦυβιΜΦν φγψ ΡΤχΤαΤ ΑΚΧΝΣρ ΨΗφΟω διαΙεΚφΘ ΡτγΖκωξ ΒτΤξΓ ρψΩΜωγ Ο\"}
"recommendation\":\"Οξα ονΜ γοηλιΡΚ ΦΕιπΜΙου ΜξΛΔπΩ υδνΥ οΡΖρΕσΗ υΧδωΤΤ πΝη ΟρχΑΒ ΚΟρτΞΚχ Γμιγ Λα\"}
"recommendation\":\"ΞΣΓβΦΔΗ τΑΑΝΓΥΙ μμΔχξ ΟγΓθ ρψΡηΖΛ ΞκχΨσΗΛΓ νυψσΔτΙ γγΛτΖοη ΞΛφΨν ΣχτσυωΠ ΞΧν ΟχφΟχωΜ τρΞβχΤγ θλΕΙΑ\"}

